import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope } from '@fortawesome/free-solid-svg-icons'
import React from 'react'

function ContactMe() {


  const handleOnSubmit = async (event) => {
    event.preventDefault()

    // const form = event.target

    // const data = Object.fromEntries(new FormData(form))
    // console.log(data)

    // fetch('/api/sessions', {
    //   method: 'POST',
    //   headers: { 'Content-Type': 'application/json' },
    //   body: JSON.stringify(data)
    // })
    //   .then(res => res.json())
    //   .then(res => {
    //     if (res.error) {
    //       setError(res.error)
    //     } else {
    //       setError(null)
    //       setLoggedInUser(res)
    //       navigate('/dashboard')
    //     }
    //   })
  }

  const handleClickSubmit = (e) => {
      e.preventDefault()
  }

  return (
    <div className="container form">
      <div className="row">
        <div className="col-md-6 offset-md-3">
          <div className="card">
            <div className="card-body">
            <h5 className="card-title">Get in Touch</h5>
            <h5 className="card-title">I do recieve your message and will respond asap if the valid email provided! </h5>
              <h2 className="card-title">Contact Me</h2>
               <div className="contact__options">
                <FontAwesomeIcon icon={ faEnvelope } />
                <h4>Email</h4>
                <h5>madie86@gmail.com</h5>
               </div>
              <form onSubmit={handleOnSubmit}>
                <div className="mb-3">
                  <label 
                  htmlFor="email" 
                  className="form-label">Your Full Name</label>
                  <input 
                    type="fullname" 
                    name="fullname" 
                    className="form-control" 
                    id="fullname" 
                    placeholder="Your Full Name"
                    required />
                </div>
                <div className="mb-3">
                  <label 
                  htmlFor="password" className="form-label">Email: </label>
                  <div className='input-group'>
                    <input 
                      type="email"
                      className="form-control" 
                      id="email" 
                      name='email' 
                      placeholder="Your Email"
                      required />
                    <div className='input-group'>
                    <textarea 
                      type="message"
                      className="form-control" 
                      id="message" 
                      name='message' 
                      placeholder="Your message"
                      />
                      <button 
                        className='btn btn-primary'
                        type='submit' 
                        onClick={handleClickSubmit}>
                          Submit   
                      </button>
                      </div>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default ContactMe;
